import React from "react";
import { Link } from "react-router-dom";
import './top.css';


const TopBanner=()=>{
    return(
        <div class="container">
            <header>
            <nav>
            <ul>
                <li><Link to='write'>일기 쓰러 가기</Link></li>
                <li><Link to='write'>지난 일기 보기</Link></li>
            </ul>
            </nav>
            <title>
            <Link to='/main' className="center">
                <p>喜 怒 哀 樂</p>
                <h1>희 노 애 락</h1>
            </Link>
            </title>
            
            
            </header>
        </div>
    )
}

export default TopBanner;
